import React from 'react';
import { Link } from 'react-router-dom';
import articleContent from './article-content';


const ArticlesList = () => (
    <>

    <h1>Articles</h1>
    {articleContent.map(article => (
        <Link to="articles/{name}">        
            <h3>{article.title}</h3>
        </Link>
    ))}

    </>
);

export default ArticlesList;
